INSERT INTO `news` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(1, 'Brigitta Schabackilt võeti hoopis tiitel ära! Miss Universe Estonia direktor: tuvastatud on rikkumine', 'Pühapäeval teatas Miss Universe lõppvõistlusel Eestit esindanud Brigitta Schaback, et on otsustanud oma missitiitlist loobuda. «Minu väärtushinnangud ja tööeetika ei ole kooskõlas riikliku direktori Natalie Korneitsiku omadega,» põhjendas ta oma otsust. Korneitsik märgib, et Schabackilt võeti hoopis tiitel tagasi vastavalt tuvastatud rikkumistele.', , 2, 1);
INSERT INTO `news` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(2, 'Vägev! Eesti tantsupaar tuli elu esimesel profitantsu MMil maailmameistriks', 'Eesti tantsupaar Artti Oskar Maasik ja Chrislyn Kullamaa osales esimest korda professionaalide 10-tantsu MMil, kus tuli kohe maailmameistriks.\r\n\r\nLaupäeval Budapestis toimunud MM oli Tallinna tantsuklubi Flexi tantsijate Maasiku ja Kullamaa jaoks esimene täiskasvanute profitantsu klassis.\r\n\r\nTreeneri Jörgen Kappi õpilaste järel lõpetas teisena Islandi paar Nicolo Barbizi ja Sara Ros Jakobsdottir, kolmanda koha saavutas Jaapani duo Kazuki Hachiya ja Madoka Minakawa.', , 1, 1);
INSERT INTO `news` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(3, 'Koolikiusajad lõikasid Portugalis klassikaaslasel sõrmeotsad maha', 'Portugali on šokeerinud juhtum, kus koolikaaslased kiusasid korduvalt Brasiiliast pärit poissi ning nende jõhkrutsemine päädis eelmisel nädalal sellega, et nad lukustasid õpilase tualettruumi ja lõikasid maha tema sõrmeotsad.\r\n\r\nJuhtum leidis aste Porto lähistel asuva Cinfãesi väikelinna Fonte Coberta põhikoolis eelmise nädala esmaspäeval. Üheksa-aastase brasiillasest poisi kaks klassikaaslast sulgesid ta kooli tualettruumi ja nüsisid lukus ukse taga maha tema kahe sõrme otsad. Lapsel ei õnnestunud abi kutsuda, mistõttu kaotas ta hulga verd ja oli sunnitud rooma vigastatuna ukse all oleva pilu kaudu välja, vahendas Euronews.\r\n\r\n', , 3, 1);
INSERT INTO `news` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(4, 'Kete Kohvik võõrustab Epp Kärsini avatud vestlusõhtut', 'Uuel aastal on võimalus osa saada Kete Kohvikus ainulaadsest vestlusõhtust, kuhu tuleb esinema Epp Kärsin – tuntud intiimsuse ja suhteõnne koolitaja. Üritusele pääseb vaid eelmüügipiletiga.\r\n\r\nKete Kohvik kutsub inimesi üles osa saama erilisest vestlusõhtust. 18. veebruaril tuleb külla Eesti üks tuntumaid intiimsuse ja teadliku läheduse koolitajaid Epp Kärsin. Hubases keskkonnas toimuval vestlusõhtul avab Kärsin ausalt ja praktiliselt, kuidas hoida suhtes kirge, kasvatada lähedust ning ületada takistusi, mis paarisuhteid aastaid proovile panevad.', , 1, 1);

